window.bookSummaryJSON = "<p><b>They hoped to create a paradise. Instead, they created hell. </b></p> <p>Phoa was terraformed by nanite swarms for Earth's colonists to create a beautiful, habitable world. But the swarms evolved, overran the planet, and two centuries later, threaten every living thing remaining on it.&nbsp;&nbsp;</p> <p>Reyes, a scientist from Phoa's last colonial enclave, and Thanata, a bioengineered hunter from a rival tribe, must work together to halt the Green: the massive swarm that absorbs plants, animals - even entire cities. But if the unlikely pair hopes to survive the mutated wilds and the deadly Green, they'll have to learn to understand each other.</p> <p><b>Don't miss this far-future, post-apocalyptic tale perfect for fans of J.N. Chaney, A.G. Riddle, and </b><b><i>Horizon Zero Dawn</i></b><b>. Grab your copy today! </b></p>"; 
